export async function getVans() {
    try {
        const res = await fetch("/api/vans");
        if (!res.ok) {
            throw new Error(`Failed to fetch vans: ${res.status} ${res.statusText}`);
        }
        const data = await res.json();
        return data.vans;
    } catch (error) {
        throw new Error("An error occurred while fetching vans: " + error.message);
    }
}
